import os
import subprocess

from qiniu import Auth, put_data, put_file
from wand.image import Image

from containts import QN_ACCESS, QN_SECRET, QN_BUCKET, QN_URL
from myppt.settings import BASE_DIR


def push_qiniu(name, file):
    q = Auth(QN_ACCESS, QN_SECRET)
    token = q.upload_token(QN_BUCKET, name)
    print(token)
    ret, info = put_data(
        token,
        name,
        file
    )
    print(ret, info)
    if info.status_code == 200:
        base_url = "%s/%s" % (QN_URL, ret.get("key"))
        return base_url
    else:
        return False


class PptTool:
    def __init__(self, docPath):
        self.docPath = docPath

    def ppt_to_pdf(self, docPath, pdfPath):
        cmd = 'libreoffice --headless --convert-to pdf'.split() + [docPath] + ['--outdir'] + [pdfPath]
        p = subprocess.Popen(cmd, stderr=subprocess.PIPE, stdout=subprocess.PIPE)
        p.wait(timeout=30)
        stdout, stderr = p.communicate()

    def pdf_to_jpg(self, pdfPath, jpgPath):
        try:
            os.mkdir(jpgPath)
        except:
            pass
        with Image(filename=pdfPath) as img:

            with img.convert('png') as converted:
                converted.save(filename=os.path.join(jpgPath, 'page.png'))

    def run(self):
        self.basename = self.docPath.rsplit('.', 1)[0].rsplit('/', 1)[1]
        jpgPath = os.path.join(BASE_DIR, 'static/jpg', self.basename)
        self.ppt_to_pdf(self.docPath, os.path.join(BASE_DIR, 'static/pdf'))
        os.remove(self.docPath)
        self.pdf_to_jpg(os.path.join(BASE_DIR, 'static/pdf', self.basename+'.pdf'), jpgPath)
        os.remove(os.path.join(BASE_DIR, 'static/pdf', self.basename+'.pdf'))
        jpg_list = list()
        for dirpath, dirnames, filenames in os.walk(jpgPath):
            jpg_list = filenames
        jpg_list = sorted(jpg_list, key=lambda x: int(x.split('-')[1].split('.')[0]))
        return self.basename, dirpath, jpg_list



